      out.write("				 	먼치킨 고양이는 짧은 다리를 가져 귀엽다고 유명한 고양이이다. 친화력도 좋아 개냥이라고도 유명하다. 하지만, 이런 짧은 다리를 마냥 귀엽게 볼 수만은 없다. 그 이유와 함께 먼치킨 고양이 특징 및 성격에 대해서도 알아보자. <br>\r\n");
      out.write("				 	먼치킨은 1944년 영국 수의학 보고서에서 처음 보고된 고양이다. 세계 2차 대전 중에는 보이지 않다가, 전쟁 후 미국, 러시아 등에서 다시 발견되기 시작했다. 1995년에는 국제 고양이 협회(TICA)에서 하나의 품종으로 인정받게 되었다. <br> \r\n");
