      out.write(" 				 <br>	\r\n");
      out.write(" 				 		<h6>▶ 크기 및 평균 수명:</h6> 먼치킨은 약 3~4kg 정도 나가는 중소형 고양이로, 약 15~18년 정도가 평균 수명으로 알려져 있다  <br><br>  \r\n");
      out.write("\r\n");
      out.write("						<h6>▶털:</h6> 먼치킨의 경우 장모종과 단모종이 있다. 어느 정도 털 빠짐은 있지만, 털 관리가 어렵지는 않은 편이라고 한다. <br><br>  \r\n");
      out.write(" 				 		\r\n");
      out.write(" 				 		<h6>▶짧은 다리:</h6> 먼치킨 고양이의 가장 큰 특징은 다리가 짧다는 것이다. 이는 유전자 조합*에 의해 나타나게 되는 특징인데, 유전자 열성, 우성 조합에 따라 긴 다리(롱레그 먼치킨)로 태어나거나 유산되는 경우도 있다. 다리가 짧아서 특히 점프 능력이 떨어지고, 야생에서의 생존 능력도 떨어지게 된다.\r\n");
